let AllPostsStyle = {
  div: {
    backgroundColor: '#eeeeee',
    height: '660px',
    textAlign: 'center',
  },
  table: {
    width: '30%',
    height: '300px',
    margin: 'auto',
    textAlign: 'left',
  },
  input: {
    width: '400px',
    height: '40px',
  },
  buttonInput: {
    width: '200px',
    height: '40px',
  },
  textareaInput: {
    width: '400px',
    minWidth: '400px',
    maxWidth: '400px',
    height: '100px',
    minHeight: '100px',
    maxHeight: '100px',
  },
  span: {
    fontSize: '25px',
    fontWeight: 'bold',
  },
}
export const AllPosts = () => {
  return (
    <div style={AllPostsStyle.div}>
      <br />
      <span style={AllPostsStyle.span}>
        Welcome Ahmad you can see resent post !
      </span>
      <br />
      <br />
      <hr />
      <br />
      <form>
        <table style={AllPostsStyle.table}></table>
      </form>
    </div>
  )
}
